import React, { useEffect, useState } from "react";
import { Container, Typography, List, ListItem, ListItemText, Paper } from "@mui/material";
import axios from "axios";

function DoctorDashboard() {
    const [patients, setPatients] = useState([]);

    useEffect(() => {
        const fetchPatients = async () => {
            try {
                const res = await axios.get("http://localhost:5000/api/doctors/patients", {
                    headers: { Authorization: `Bearer ${localStorage.getItem("token")}` }
                });
                setPatients(res.data);
            } catch (error) {
                console.error("Error fetching patients:", error);
            }
        };

        fetchPatients();
    }, []);

    return (
        <Container maxWidth="md">
            <Paper elevation={3} style={{ padding: "20px", marginTop: "50px" }}>
                <Typography variant="h4" align="center" gutterBottom>Doctor Dashboard</Typography>
                <Typography variant="h6">Assigned Patients</Typography>
                <List>
                    {patients.map((patient) => (
                        <ListItem key={patient.id}>
                            <ListItemText primary={patient.name} secondary={patient.email} />
                        </ListItem>
                    ))}
                </List>
            </Paper>
        </Container>
    );
}

export default DoctorDashboard;
